import React, {useState, useEffect} from 'react'
import { Container } from 'react-bootstrap'
import './SellerDashboard.css';
import Sidebar from '../../components/Sidebar';
import SellerNavBar from '../../components/sellerNavBar';
import SellerPrevOrders from '../SellerPrevOrders/SellerPrevOrders';
import ToggleButton from '../../components/ToggleButton';


function SellerDashboard() {

    const [isOn, setIsOn] = useState(false);




    return (
        <div class="d-flex flex-row min-vh-100" >
            <div class="min-vh-100 d-xl-flex d-none flex-shrink-0" style={{ flex: 1, flexDirection: "column" }}>
                <Sidebar />
            </div>
            <div class="dashboard d-flex flex-shrink-1" style={{ flexDirection: "column" }}>
                <SellerNavBar />
                <Container className="mt-xl-5" style={{ flex: 1 }}>
                    <p className="display-4 mb-5">Your Previous Orders</p>

                    <SellerPrevOrders />
                    <ToggleButton isOn={true} onClick={() => 
                          setIsOn(!isOn)} />
                </Container>
            </div>
        </div>
    )
}

export default SellerDashboard
